import React from 'react';
import './pagecomp.css';

export default function PageComp({ title, content }) {
  return (
    <div className='pagescreen'>
      <h1>{title}</h1>
      <div className='movies-container'>
        {content.map((item) => (
          <div key={item.id} className='image-text-div'>
            <img
              alt={item.title}
              src={`https://image.tmdb.org/t/p/w500${item.poster_path}`}
            />
            <h2>{item.title}</h2>
            <p>ID: {item.id}</p> {/* Display the ID */}
          </div>
        ))}
      </div>
    </div>
  );
}
